var reDat = dataset.slice(0,30);

function initMap() {
    //Map options
    var options = {
        zoom: 8,
        center: { lat: 7.40801, lng: -1.96317 }
    }
    //New map
    var map = new google.maps.Map(document.getElementById('map'), options);

    //Array of markers
    var markers = reDat;

    // Loop through markers
    for (var i = 0; i < markers.length; i++) {
        addMarker(markers[i]);
    }

    // Add marker function
    function addMarker(props) {
        coords = {lat: props.Latitude, lng: props.Longitude}
        content = '<h4>'+props.FacilityName+'</h4><p><strong>Town: </strong>'+props.Town+'</p>'
        var marker = new google.maps.Marker({
            position: coords,
            map: map
            //icon: hospital icon
        });

        // Check content
        if (content) {
            var infoWindow = new google.maps.InfoWindow({
                content: content
            });

            marker.addListener('click', function () {
                infoWindow.open(map, marker);
            })
        }
    }
}

